import NavItem from "./navitem";

const NavBar = (props) => {
	return (
		<nav className="navbar">
			<ul className="navbar-nav">
				<li className="nav-bar-webtitle">Self OKRs</li>
				<NavItem title={"Goals"} />
				<NavItem title={props.username} />
			</ul>
		</nav>
	);
}

export default NavBar;
